import Home from "../components/views/Home";
import Login from "../components/views/Home";
import Contact from "../components/views/Home";


const HOME = { component: Home, path: "/", isPrivate: false };
const LOGIN = { component: Home, path: "/login", isPrivate: false };
const CONTACTUS = { component: Home, path: "/contact-us", isPrivate: false };

export default [HOME, LOGIN, CONTACTUS];
